pragma solidity >=0.6.0;

import "@openzeppelin/contracts/math/SafeMath.sol";
// import "@chainlink/contracts/src/v0.6/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

contract MasterFarm {
    using SafeMath for uint256;
    using SafeMath for uint16;

    //using ERC20 for IERC20;

    string public name = "PolkaBridge: Deflationary Farming";
    address payable private owner;
    //AggregatorV3Interface internal priceFeed;
    address internal constant UNISWAP_ROUTER_ADDRESS =
        0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D;

    IUniswapV2Router02 public uniswapRouter;
    address private PBRKinbery = 0x0D6ae2a429df13e44A07Cd2969E085e4833f64A0;
    address private ETHPBRKinbery = 0xE45BCdd0331B8Fe947e44Ae9db7828D8e160E2Be;

    uint16 constant TotalBlockPerDay = 7500;
    uint256 constant AvgRewardPerBlock = 500000000000000000; //0.5
    uint256 constant TimeInYear = 31536000;
    mapping(uint16 => uint256) Totalrewardclaimed;

    struct User {
        uint256 BeginTime;
        uint256 EndTime;
        uint16 BeginBlock;
        uint16 EndBlock;
        uint256 TotalClaimReward;
        uint256 TotalLPDeposit;
        uint256 CurrentTokenFarm;
    }

    struct Pool {
        uint16 PoolId;
        string PoolName;
        uint256 BeginDate;
        uint256 EndDate;
        address MainToken;
        address BaseToken;
    }

    constructor() public {
        owner = msg.sender;
        uniswapRouter = IUniswapV2Router02(UNISWAP_ROUTER_ADDRESS);
        // priceFeed = AggregatorV3Interface(
        //     0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
        // ); //eth usd ob Ribiky
    }

    function getEstimatedLPETH_PBRforPBR(uint256 lpAmount)
        public
        view
        returns (uint256[] memory)
    {
        return uniswapRouter.getAmountsIn(lpAmount, getPathForLPETH_PBRToPBR());
    }

    function getPathForLPETH_PBRToPBR()
        private
        view
        returns (address[] memory)
    {
        address[] memory path = new address[](2);
        path[0] = ETHPBRKinbery;
        path[1] = PBRKinbery;

        return path;
    }

    // function getLatestPrice() public view returns (int256) {
    //     (
    //         uint80 roundID,
    //         int256 price,
    //         uint256 startedAt,
    //         uint256 timeStamp,
    //         uint80 answeredInRound
    //     ) = priceFeed.latestRoundData();
    //     return price;
    // }

    receive() external payable {}
}
